  const [myResult, setmyResult] = useState({});

  const test = async () => {
    fetch(`${strangerThings}/${cohort}/users/me`, {
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${localStorage.getItem("token")}`,
      },
    })
